import React from "react"; 

const Home = () => {
    return(
        <div>
            <h1>Login to your account</h1>
            <p>We're happy to see you return ! Please log in to continues.</p>
            <input type = "email" id = "email" name = "email" /><br/>
            <input type = "password" id = "password" name = "password" />
        </div>
    ) 
}
export default Home;
